(249, 'AMH', 'Amperio hora', 'Unidad de carga electrica definida por la cantidad de carga acumulada por un flujo constante de un amperio por 1 hora.', '', '2022-01-01', '0000-00-00', 'A·h', '4.00', 5, '2022-09-25 04:40:29'),
(250, 'AMP', 'Amperio', 'Es la intensidad de una corriente constante que manteniéndose en dos conductores paralelos, rectilíneos, de longitud infinita, de sección circular despreciable y situados a una distancia de un metro uno de otro en el vacío, produciría una fuerza igual a 2·10-7 newton por metro de longitud.', '', '2022-01-01', '0000-00-00', 'A', '4.00', 5, '2022-09-25 04:40:29'),
