(959, 'GFI', 'Gramo de isótopo fisible', 'Unidad de masa que define el número de gramos de un isótopo fisible (isótopo fisible: un isótopo cuyo núcleo es capaz de ser dividido cuando se irradia con neutrones de baja energía).', '', '2022-01-01', '0000-00-00', 'gi F/S', '4.00', 5, '2022-09-25 04:40:53'),
