(961, 'GH', 'Medio galón (US)', '', 'Las unidades marcadas como borradas en el catálogo internacional de UNECE, serán retenidas indefinidamente en las listas de códigos. En su caso, estas unidades podrán ser reinstalado a través del proceso de mantenimiento.', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:53'),
(962, 'GIA', 'Gill (us)', 'Es Unidad de volumen inglesa en el sistema imperial y en los Estados Unidos. La versión imperial usada en el UK es de 5 onzas líquidas, y es equivalente a 142,0653125 ml; mientras que en los EUA es de 4 onzas líquidas, y es equivalente a 118,29411825 ml.', '', '2022-01-01', '0000-00-00', 'gi (US)', '4.00', 5, '2022-09-25 04:40:53'),
(963, 'GIC', 'Gramo, incluido el contenedor', 'Unidad de masa que define el número de gramos de un producto, incluyendo su recipiente.', '', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:53'),
(964, 'GII', 'Gill (uk)', 'Es Unidad de volumen inglesa en el sistema imperial y en los Estados Unidos. La versión imperial usada en el UK es de 5 onzas líquidas, y es equivalente a 142.0653125 ml; mientras que en los EUA es de 4 onzas líquidas, y es equivalente a 118.29411825 ml.', '', '2022-01-01', '0000-00-00', 'gi (UK)', '4.00', 5, '2022-09-25 04:40:53'),
(965, 'GIP', 'Grama, incluido el embalaje interior', 'Unidad de masa que define el número de gramos de un producto, incluyendo sus materiales de envasado interior.', '', '2022-01-01', '0000-00-00', '', '4.00', 5, '2022-09-25 04:40:53'),
